import cv2
import numpy as np
import os
import glob

# Define directories (update these paths as needed)
image_dir = "/content/drive/MyDrive/jobs/ErcanTest/images"
annotation_dir = "/content/drive/MyDrive/jobs/ErcanTest/labels"
output_dir = "/content/drive/MyDrive/jobs/ErcanTest/output"

# Create the output directory if it doesn't exist
os.makedirs(output_dir, exist_ok=True)

# Get all image files (adjust extension if needed)
image_files = glob.glob(os.path.join(image_dir, "*.png"))
print("Found image files:", image_files)

def draw_segmentation_masks(image_path, annotation_path):
    # Load the image
    image = cv2.imread(image_path)
    if image is None:
        print(f"Could not load image: {image_path}")
        return None

    height, width, _ = image.shape

    # Read the annotation file
    with open(annotation_path, "r") as file:
        lines = file.readlines()

    for line in lines:
        data = line.strip().split()
        if not data:
            continue

        # Parse label and polygon points (supporting numeric and string labels)
        try:
            # Try converting the first token to an integer
            class_id = int(data[0])
            label = str(class_id)
            polygon_points = list(map(float, data[1:]))
        except ValueError:
            # Otherwise, treat the first token as a string label
            label = data[0]
            polygon_points = list(map(float, data[1:]))

        # Convert normalized coordinates to pixel coordinates
        points = np.array([
            (int(polygon_points[i] * width), int(polygon_points[i+1] * height))
            for i in range(0, len(polygon_points), 2)
        ], np.int32)
        points = points.reshape((-1, 1, 2))

        # Draw the polygon outline
        cv2.polylines(image, [points], isClosed=True, color=(0, 255, 0), thickness=2)

        # Create a semi-transparent overlay for the polygon fill
        overlay = image.copy()
        cv2.fillPoly(overlay, [points], color=(0, 255, 0))
        alpha = 0.4  # Transparency factor
        cv2.addWeighted(overlay, alpha, image, 1 - alpha, 0, image)

        # Optionally, draw the label near the first vertex of the polygon
        text_position = (points[0][0][0], points[0][0][1] - 10)
        cv2.putText(image, label, text_position, cv2.FONT_HERSHEY_SIMPLEX, 0.5, (0, 0, 255), 2)

    return image

# Process images and save the results
for image_path in image_files:
    # Construct the corresponding annotation file path from the annotation directory
    basename = os.path.basename(image_path)  # e.g., "image1.png"
    name_without_ext = os.path.splitext(basename)[0]
    annotation_path = os.path.join(annotation_dir, name_without_ext + ".txt")

    if os.path.exists(annotation_path):
        # Process the image and draw segmentation masks
        segmented_image = draw_segmentation_masks(image_path, annotation_path)
        if segmented_image is None:
            continue

        # Save the resulting image to the output directory
        output_path = os.path.join(output_dir, basename)
        cv2.imwrite(output_path, segmented_image)
        print(f"Saved segmented image to {output_path}")
    else:
        print(f"No annotation found for {image_path}")